import React from 'react';

type TaskType = {
    task:Array<ArrayTaskType>
}

type ArrayTaskType = {
    id:number;
    title:string;
    isDone:boolean
}


export  const ToDolist = (props:TaskType) => {
    <h3></h3>
    return (
        <div>  {props.task.map((el)=>{
            return(
                <div>{ <li key={el.id}>
                    {el.title}
                </li>

                }
                    <input  type={"checkbox"} checked={el.isDone} />
                    <button>x</button>
                </div>
            )
        })}


        </div>
    );
};
